import React, { useState } from 'react';
import Card from '@material-ui/core/Card';
import CardContent from '@material-ui/core/CardContent';
import Button from '@material-ui/core/Button';
import FormControl from '@material-ui/core/FormControl';
import TextField from '@material-ui/core/TextField';
import Typography from '@material-ui/core/Typography';
import styled from "styled-components";
import { makeStyles } from '@material-ui/core/styles';
import CardMedia from '@material-ui/core/CardMedia';
import CardActionArea from '@material-ui/core/CardActionArea';
import CardActions from '@material-ui/core/CardActions';
import BgImage from './_assets/bg3.jpg';
import Novisync from './_assets/Novisync.png';
import Bigapp from './_assets/bigapp.png';




const MainDiv = styled.main`

@media (max-width: 768px) {
    width:100%;
    margin:15px;

  }
  @media (max-width: 458px) {

  }
  @media (width: 375px) {

  }
  @media (width: 425px) {

  }

`;


//card 1

const MainCard = styled(Card)`

@media (max-width: 768px) {
    width:90%;
    margin:0px;
    // margin-right:50px;

  }
  @media (max-width: 458px) {

  }
  @media (width: 375px) {

  }
  @media (width: 425px) {

  }

`;

const ContentDiv = styled.div`
margin-top:120px;

@media (max-width: 768px) {
    width:100%;
    margin:0px;

  }
  @media (max-width: 458px) {

  }
  @media (width: 375px) {

  }
  @media (width: 425px) {

  }
`;

const CardContentDiv = styled(CardContent)`
    background-color:#D0ECE7;
    background-image: url(${BgImage});
    height:300px;
    @media (max-width: 768px) {
        width:100%;
        margin:0px;
        height:300px;
      }
      @media (max-width: 458px) {

      }
      @media (width: 375px) {

      }
      @media (width: 425px) {

      }   
`;

const TextDiv = styled.h1`
font-family:Impact, fantasy;
color:white;
`;
const TextDiv1 = styled.h3`
font-family:Courier New, monospace; 
color:white;
`;

const Break = styled.div`
margin-bottom:40px;

`
const TypographyDiv = styled(Typography)`

`
const TextDiv3 = styled.p`
font-weight:500px;
font-size:30px;
font-family:Zapf Chancery, cursive;
color:black;
`;


//text

const HeaderTag = styled.h3`
font-family:Brushstroke, fantasy;
margin-left:10px;
`;
const HeaderTag1 = styled.h3`
font-family:Impact, fantasy;
margin-left:10px;
`;

const SideHeaderTage = styled.p`
font-family:Palatino, serif;
font-size:20px;
margin-left:40px;
font-weight:500px;
`;

const Logo1 = styled.img`
width : 300px;
float:right;
margin-right:100px;
`;

const MainCard1 = styled(Card)`
width:540px;
margin-left:30px;
border-radius:30px;
`;
const MainCard2 = styled(Card)`
width:540px;
margin-left:120px;
border-radius:30px;
`;
const MainCard3 = styled(Card)`
width:540px;
margin-left:230px;
border-radius:30px;
`;

const CardContentDiv2 = styled(CardContent)`
background-color:#A2D9CE ;
color:white;
`;
const CardContentDiv3 = styled(CardContent)`
background-color:#7DCEA0  ;
color:white;
`;
const CardContentDiv4 = styled(CardContent)`
background-color:#27AE60 ;
color:white;
`;

function PortFolio(props) {

    return (
        <MainDiv>
            <MainCard >
                <CardContentDiv>
                    <ContentDiv> </ContentDiv>
                    <center>
                        <TextDiv>
                            Hi I'm Sethu Kumar
                 </TextDiv>
                        <TextDiv1>
                            React Web Developer(React,Redux,Mobx,Html,Css,Javascript)
                 </TextDiv1>
                    </center>
                </CardContentDiv>
            </MainCard>
            <Break />
            <center>
                <TypographyDiv>
                    <TextDiv3>
                        Work Experience
                    </TextDiv3>
                </TypographyDiv>
            </center>
            <Break />

            <HeaderTag>
            BigAppCompany (2020-Feb) :
            </HeaderTag>
            <Logo1 src={Bigapp} />
            <HeaderTag1>
              Project :
            </HeaderTag1>

            <MainCard1> 
            <CardContentDiv2>
            <SideHeaderTage>
              Curio Travel and Expense  (Frontend Developer)
            </SideHeaderTage>
            </CardContentDiv2>
            </MainCard1>
            <Break />

            <HeaderTag>
              Novisync India Private Limited (2018-Nov to 2020-Jan) :
            </HeaderTag>
            <Logo1 src={Novisync} />
            <HeaderTag1>
              Projects :
            </HeaderTag1>

            <MainCard1> 
            <CardContentDiv2>
            <SideHeaderTage>
              NExam-Online Test Project  (Frontend Developer)
            </SideHeaderTage>
            </CardContentDiv2>
            </MainCard1>
            <Break />

            <MainCard2> 
            <CardContentDiv3>
            <SideHeaderTage>
              Novisync Website  (Reactjs Web Developer)
            </SideHeaderTage>
            </CardContentDiv3>
            </MainCard2>

            <Break />
            <MainCard3> 
            <CardContentDiv4>
            <SideHeaderTage>
              Jobbuzz  (Reactjs Web Developer)
            </SideHeaderTage>
            </CardContentDiv4>
            </MainCard3>








    {/* <MainCard1 >
      <CardActionArea>
        <CardMediaDiv
          image="./_assets/cadraclabs.jpeg"
        //   title="Contemplative Reptile"
        />
        <CardContentDiv1>
          <Typography gutterBottom variant="h5" component="h2">
            Cabraclabs Website
          </Typography>
          <Typography variant="body2" color="textSecondary" component="p">
            Devepeloped Website using React,Html,Css,Javascript
          </Typography>
        </CardContentDiv1>
      </CardActionArea>
    </MainCard1> */}
    </MainDiv>
    );
}

export default PortFolio;
